<!DOCTYPE html>
<!-- saved from url=(0078)https://www.mathworks.com/help/search/remote/proxy/1.3/iframeProxyRelease.html -->
<html><head><meta http-equiv="Content-Type" content="text/html; charset=windows-1252">
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
    <script>
        /*
         * This function returns the query string.
         * Eg: https://routingHost.mathworks.com?routingKey=1234 returns "?routingKey=1234"
         *     https://mlsedu return ""
         */
        (function () {
            var getRoutingKey = function () {
                return location.search;
            };

            var script = document.createElement("script");
            script.setAttribute("type", "text/javascript");
            script.setAttribute("src", "iframeProxy.main.js" + getRoutingKey());
            document.getElementsByTagName("head")[0].appendChild(script);
        })();
    </script><script type="text/javascript" src="./iframeProxy.main.js"></script>
</head>
<body>

</body></html>
